@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:CashCard a owl:Class .
atm:Customer a owl:Class .

atm:belongsToBank a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:ownsCard a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:BankCode a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:belongsToBank ;
                      owl:someValuesFrom [ a owl:Class ;
                                           owl:unionOf (atm:ValidBankCode atm:InvalidBankCode) ] ] .

atm:ValidBankCode a owl:Class ;
    rdfs:subClassOf atm:BankCode .

atm:InvalidBankCode a owl:Class ;
    rdfs:subClassOf atm:BankCode .
